/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="ui5-list-root"	@focusin="${context._onfocusin}"	@keydown="${context._onkeydown}"	@scroll="${context._onScroll}"><!-- header -->	${ context.header.length ? block1(context) : undefined }${ context.shouldRenderH1 ? block2(context) : undefined }<div id="${ifDefined(context._id)}-before" tabindex="0" class="ui5-list-focusarea"></div><ul id="${ifDefined(context._id)}-listUl" class="ui5-list-ul" aria-multiselectable="${ifDefined(context.isMultiSelect)}" aria-labelledby="${ifDefined(context.ariaLabelledBy)}" role="listbox"><slot></slot>		${ context.showNoDataText ? block3(context) : undefined }</ul>	${ context.footerText ? block4(context) : undefined }${ context.showBusy ? block5(context) : undefined }<div id="${ifDefined(context._id)}-after" tabindex="0" class="ui5-list-focusarea"></div></div>`; };
const block1 = (context) => { return html`<slot name="header" />	`; };
const block2 = (context) => { return html`<header id="${ifDefined(context.headerID)}" class="ui5-list-header">			${ifDefined(context.headerText)}</header>	`; };
const block3 = (context) => { return html`<li id="${ifDefined(context._id)}-nodata" class="ui5-list-nodata" tabindex="${ifDefined(context.noDataTabIndex)}"><div id="${ifDefined(context._id)}-nodata-text" class="ui5-list-nodata-text">					${ifDefined(context.noDataText)}</div></li>		`; };
const block4 = (context) => { return html`<footer id="${ifDefined(context._id)}-footer" class="ui5-list-footer">			${ifDefined(context.footerText)}</footer>	`; };
const block5 = (context) => { return html`<div class="ui5-list-busy-row"><ui5-busyindicator ?active="${context.busy}" size="Medium" class="ui5-list-busy-ind"></ui5-busyindicator></div>	`; };

export default block0;
